sniffer:
  enable: true
  force-dns-mapping: true
  override-destination: false
  parse-pure-ip: true
  skip-domain:
  - +.push.apple.com
  sniff:
    HTTP:
      ports:
      - 80
      - 8080-8880
      override-destination: true
    TLS:
      ports:
      - 443
      - 8443
    QUIC:
      ports:
      - 443
      - 8443
socks-port: 1080
tcp-concurrent: true
tun:
  auto-detect-interface: true
  auto-redirect: true
  auto-route: true
  enable: true
  dns-hijack:
  - any:53
  - tcp://any:53
  stack: mixed
unified-delay: true
